import React from 'react'
import classes from './Trending.module.css';
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";

import Slider from "react-slick";
import bg1 from '../assets/bg1.jpg';

function SampleNextArrow(props) {
  const { className, style, onClick } = props;
  return (
    // <div
    //   className={className}
    //   style={{ ...style,  background: "red",borderRadius:'50%' }}
    //   onClick={onClick}
    // />
    <svg width="20" height="20" viewBox="0 0 20 20" fill="none" xmlns="http://www.w3.org/2000/svg" onClick={onClick}>
    <path d="M14.5148 4.51477L13.6239 5.40567L17.5882 9.37004H0V10.63H17.5882L13.6239 14.5943L14.5148 15.4852L20 9.99996L14.5148 4.51477Z" fill="#0a9e88"/>
    </svg>
  );
}

function SamplePrevArrow(props) {
  const { className, style, onClick } = props;
  return (
    // <div
    //   className={className}
    //   style={{ ...style, display: "block", background: "green" }}
    //   onClick={onClick}
    // />
    <svg width="20" height="20" viewBox="0 0 20 20" fill="none" xmlns="http://www.w3.org/2000/svg" onClick={onClick}>
<path d="M5.48524 4.51477L6.3761 5.40567L2.41178 9.37004H20V10.63H2.41178L6.3761 14.5943L5.48524 15.4852L0 9.99996L5.48524 4.51477Z" fill="#0a9e88"/>
</svg>
  );
}

export default function Trending() {
  const settings = {

    dots: false,
    infinite: true,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay:true,
    autoplaySpeed:2000,
    nextArrow: <SampleNextArrow />,
    prevArrow: <SamplePrevArrow />
  };
  return (
    <div className={classes['s-container']}>
        <h2>Custom Arrows</h2>
        <div className={classes['s-wrapper']}>
        <Slider {...settings}>
          <div className={classes['slide-detail']}>
          <div className={classes['slide-bgg']}></div>
            <h3>1</h3>
          </div>
          <div>
            <h3>2</h3>
          </div>
          <div>
            <h3>3</h3>
          </div>
          <div>
            <h3>4</h3>
          </div>
          <div>
            <h3>5</h3>
          </div>
          <div>
            <h3>6</h3>
          </div>
        </Slider>
        </div>
       
      </div>
  )
}
